/* Procedure structure for procedure `st_payment_history` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `st_payment_history`(IN frmdt date,IN todt DATE,in classid int,
    in section int,in studentid int,in schoolid int,in acd_sesid int)
BEGIN
   
	DELETE FROM temp_table_payment;
  if studentid != 0 
  then
  INSERT INTO temp_table_payment(payment_master_id,classname,studentname,section,roll,payment_date,memono,amount) 
    
    SELECT 
	payment_master.payment_id,
	class_master.classname,
	student_master.name,
	section_master.section,
	academic_details.rollno,
	#payment_master.payment_date,
	DATE_FORMAT(payment_master.payment_date, '%d-%m-%Y'),
	payment_master.memono,
	payment_master.total_amount
	FROM payment_master
	INNER JOIN student_master
	ON student_master.student_id=payment_master.student_id
	INNER JOIN academic_details
	ON academic_details.student_id=payment_master.student_id
	INNER JOIN class_master
	ON class_master.id=academic_details.class_id
	INNER JOIN section_master
	ON section_master.id=academic_details.section_id
	WHERE payment_master.student_id=studentid
	and payment_master.`acdm_session_id`=acd_sesid;
else if classid != 0 and section != 0
     THEN
  INSERT INTO temp_table_payment(payment_master_id,classname,studentname,section,roll,payment_date,memono,amount) 
    
    SELECT 
	payment_master.payment_id,
	class_master.classname,
	student_master.name,
	section_master.section,
	academic_details.rollno,
	#payment_master.payment_date,
	DATE_FORMAT(payment_master.payment_date, '%d-%m-%Y'),
	payment_master.memono,
	payment_master.total_amount
	FROM payment_master
	INNER JOIN student_master
	ON student_master.student_id=payment_master.student_id
	INNER JOIN academic_details
	ON academic_details.student_id=payment_master.student_id
	INNER JOIN class_master
	ON class_master.id=academic_details.class_id
	INNER JOIN section_master
	ON section_master.id=academic_details.section_id
	WHERE academic_details.class_id = classid
	and academic_details.section_id = section
	AND payment_master.`acdm_session_id`=acd_sesid;
ELSE IF classid != 0
     THEN
  INSERT INTO temp_table_payment(payment_master_id,classname,studentname,section,roll,payment_date,memono,amount) 
    
    SELECT 
	payment_master.payment_id,
	class_master.classname,
	student_master.name,
	section_master.section,
	academic_details.rollno,
	#payment_master.payment_date,
	DATE_FORMAT(payment_master.payment_date, '%d-%m-%Y'),
	payment_master.memono,
	payment_master.total_amount
	FROM payment_master
	INNER JOIN student_master
	ON student_master.student_id=payment_master.student_id
	INNER JOIN academic_details
	ON academic_details.student_id=payment_master.student_id
	INNER JOIN class_master
	ON class_master.id=academic_details.class_id
	INNER JOIN section_master
	ON section_master.id=academic_details.section_id
	WHERE academic_details.class_id = classid
	AND payment_master.`acdm_session_id`=acd_sesid;
	
	
else
	
	INSERT INTO temp_table_payment(payment_master_id,classname,studentname,section,roll,payment_date,memono,amount) 
    
        SELECT 
	payment_master.payment_id,
	class_master.classname,
	student_master.name,
	section_master.section,
	academic_details.rollno,
	#payment_master.payment_date,
	DATE_FORMAT(payment_master.payment_date, '%d-%m-%Y'),
	payment_master.memono,
	payment_master.total_amount
	FROM payment_master
	INNER JOIN student_master
	ON student_master.student_id=payment_master.student_id
	INNER JOIN academic_details
	ON academic_details.student_id=payment_master.student_id
	INNER JOIN class_master
	ON class_master.id=academic_details.class_id
	INNER JOIN section_master
	ON section_master.id=academic_details.section_id
	WHERE payment_master.`acdm_session_id`=acd_sesid
	and payment_master.payment_date BETWEEN frmdt AND todt;
	
	
    
        end if;
        END IF;
        END IF;
    
  
    END */$$
DELIMITER ;

/* Procedure structure for procedure `usp_generalLedgerStyle3` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_generalLedgerStyle3`(
fromdate DATE,todate DATE,companyid INT,yearid INT,accountid INT,fiscalStartDate DATE)
BEGIN
DECLARE m_opening_balance DECIMAL(18,2) DEFAULT 0;
DECLARE m_account_opening_master_opening DECIMAL(18,2)DEFAULT 0;
DECLARE balance DECIMAL(18,2)DEFAULT 0;
DECLARE totcredit DECIMAL(18,2)DEFAULT 0;
DECLARE totdebit DECIMAL(18,2)DEFAULT 0;
DECLARE creditBalance DECIMAL(18,2)DEFAULT 0;
DECLARE debitBalance DECIMAL(18,2)DEFAULT 0;
DECLARE v_openingdebitbalance DECIMAL(18,2);
DECLARE v_openingcreditbalance DECIMAL(18,2);
DROP TEMPORARY TABLE IF EXISTS TempTable1;	
CREATE TEMPORARY TABLE TempTable1
(
	vchId INT,
	vchNumber VARCHAR(50),
	debitamount DECIMAL(12,2),
	creditamount DECIMAL(12,2),
	isdebit CHAR(1),
	Naration TEXT,
	VchType VARCHAR(50),
	VchDate DATE,
	VchAccountDetailscrdrtag TEXT,
	VchAccountDetailsAccountName TEXT,
	VchAccountDetailsAmount TEXT
);
BEGIN
SET v_openingdebitbalance := 0;
SET v_openingcreditbalance :=0;
	
SET m_account_opening_master_opening= (
SELECT `account_opening_master`.`opening_balance`
FROM `account_opening_master`
INNER JOIN 
`account_master` ON `account_opening_master`.`account_master_id` = `account_master`.`account_id`
WHERE `account_master`.`school_id` =companyid
AND `account_opening_master`.`acdm_session_id` =yearid AND `account_master`.`account_id` = accountid);
IF fromdate > fiscalStartDate THEN
SELECT SUM(IFNULL(vd.`voucher_amount`,0)) INTO v_openingdebitbalance
	FROM voucher_detail vd
	INNER JOIN voucher_master vm
	ON vm.id=vd.`voucher_master_id` 
	WHERE vd.`account_master_id` =accountId AND (vm.`voucher_date`>=fiscalStartDate AND vm.`voucher_date` < fromdate)
	AND vm.`school_id` = companyid AND vm.`acdm_session_id` = yearid AND vd.`is_debit` ='Y'
	GROUP BY vd.`account_master_id` ORDER BY vd.`account_master_id`;
	
SELECT SUM(IFNULL(vd.`voucher_amount`,0)) INTO v_openingcreditbalance
	FROM voucher_detail vd
	INNER JOIN voucher_master vm
	ON vm.id=vd.`voucher_master_id` 
	WHERE vd.`account_master_id` =accountId AND (vm.`voucher_date`>=fiscalStartDate AND vm.`voucher_date` < fromdate)
	AND vm.`school_id` = companyid AND vm.`acdm_session_id` = yearid AND vd.`is_debit` ='N'
	GROUP BY vd.`account_master_id` ORDER BY vd.`account_master_id`;
END IF;
SET m_opening_balance :=0;
SET m_opening_balance := m_account_opening_master_opening + (v_openingdebitbalance - v_openingcreditbalance);
IF m_opening_balance>0 THEN
INSERT INTO `TempTable1`
            (`vchId`,`vchNumber`,`debitamount`,`creditamount`,
             `isdebit`,`Naration`,`VchType`,`VchDate`,`VchAccountDetailscrdrtag`,
             `VchAccountDetailsAccountName`,`VchAccountDetailsAmount`)
VALUES (0, 'Opening', m_opening_balance,0,
        'Y','Opening','Opening',fromdate,'Dr',
        '','');
ELSE
SET m_opening_balance = m_opening_balance * -1;
INSERT INTO `TempTable1`
            (`vchId`,`vchNumber`,`debitamount`,`creditamount`,
             `isdebit`,`Naration`,`VchType`,`VchDate`,`VchAccountDetailscrdrtag`,
             `VchAccountDetailsAccountName`,`VchAccountDetailsAmount`)
VALUES (0, 'Opening', 0,m_opening_balance,
        'N','Opening','Opening',fromdate,'Cr',
        '','');
   
END IF;
END;
INSERT INTO `TempTable1`
            (`vchId`,`vchNumber`,`debitamount`,`creditamount`,
             `isdebit`,`Naration`,`VchType`,`VchDate`,`VchAccountDetailscrdrtag`,
             `VchAccountDetailsAccountName`,`VchAccountDetailsAmount`)
SELECT
 vm.id,
 vm.`voucher_number`,
 (CASE 
	WHEN vd.`is_debit` = 'Y' THEN vd.`voucher_amount`
	ELSE 0
	END
 )AS debitedamount, 
 (
	CASE 
	WHEN vd.`is_debit` = 'N' THEN vd.`voucher_amount`
	ELSE 0
	END
 )AS creditedamount, 
 vd.`is_debit`, 
 vm.`narration`, 
 CASE
				  WHEN vm.`transaction_type` = 'PY' 
                                  THEN 'Payment'
                                  WHEN vm.transaction_type = 'SL' 
                                  THEN 'Sales' 
                                  WHEN vm.transaction_type = 'PR' 
                                  THEN 'Purchase' 
                                  WHEN vm.transaction_type = 'RC' 
                                  THEN 'Receipt' 
                                  WHEN vm.transaction_type = 'CN' 
                                  THEN 'Contra' 
                                  WHEN vm.transaction_type = 'JV' 
                                  THEN 'Journal' 
                                  WHEN vm.transaction_type = 'GV' 
                                  THEN 'General' 
                                  WHEN vm.transaction_type = 'RP' 
                                  THEN 'Purchase' 
                                  WHEN vm.transaction_type = 'RS' 
                                  THEN 'Sales' 
                                  WHEN vm.transaction_type = 'VADV' 
                                  THEN 'Advance' 
                                  WHEN vm.transaction_type = 'CADV' 
                                  THEN 'Advance' 
                      END AS trantype,
  vm.`voucher_date`,
 (SELECT GROUP_CONCAT( voucher_detail.`is_debit`)   FROM voucher_detail 
WHERE voucher_detail.`voucher_master_id` = vm.id AND voucher_detail.`account_master_id` <>accountid   )AS crDrTag,
 (SELECT GROUP_CONCAT( account_master.`account_name`)   FROM voucher_detail
 INNER JOIN `account_master` ON  voucher_detail.`account_master_id` = account_master.`account_id` 
WHERE voucher_detail.`voucher_master_id` = vm.id AND voucher_detail.`account_master_id` <>accountid   )AS associate_assoc,
(SELECT GROUP_CONCAT( voucher_detail.`voucher_amount`)   FROM voucher_detail 
WHERE voucher_detail.`voucher_master_id` = vm.id AND voucher_detail.`account_master_id` <>accountid  )AS amount_assoc
FROM
`voucher_master` vm
INNER JOIN
`voucher_detail` vd ON `vm`.`id` = `vd`.`voucher_master_id`
WHERE `vd`.`account_master_id` = accountid AND vm.`school_id`=companyid AND vm.`acdm_session_id`=yearid
AND vm.`voucher_date` BETWEEN fromdate AND todate;
SELECT * FROM TempTable1;
END */$$
DELIMITER ;

/* Procedure structure for procedure `usp_TrialBalance` */

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_TrialBalance`(
		CompanyId INT,
		YearId INT,
		fromDate DATETIME,
		toDate DATETIME,
		fiscalstartdate DATETIME
    )
BEGIN
	  DECLARE totdebit DECIMAL(12,2);
	  DECLARE totcredit DECIMAL(12,2);
	  DECLARE AccountId INT;
	  DECLARE AccountName VARCHAR(50);
	  DECLARE OpeningBalance DECIMAL(12,2);
	  DECLARE ClosingBalance DECIMAL(12,2);
	  DECLARE amount DECIMAL(12,2);
	  DECLARE isdebit BIT;
	  DECLARE balance DECIMAL(12,2);
	  DECLARE ismaster BIT;
	  
	  DECLARE totdebit_String VARCHAR(50);
	  DECLARE totcredit_String VARCHAR(50);
	  DECLARE balance_String DECIMAL(12,2);
	  DECLARE opbal DECIMAL(12,2);
	  -- closing balance variable 01-12-2016
	    DECLARE debitBalance DECIMAL(12,2);
	    DECLARE creditBalance DECIMAL(12,2);
	  -- closing balance variable 01-12-2016
	  DECLARE exit_loop BOOLEAN;
	DECLARE MYCURSOR CURSOR FOR
		SELECT AM.account_name, IFNULL(account_opening_master.opening_balance,0) AS opening,AM.account_id
		FROM account_master AM
		LEFT JOIN account_opening_master ON  AM.account_id = account_opening_master.account_master_id 
		AND account_opening_master.acdm_session_id =YearId
		WHERE AM.school_id=CompanyId 
		ORDER BY AM.account_name;
        
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET exit_loop = TRUE;
	
	DROP TEMPORARY TABLE IF EXISTS finaltab;
	CREATE TEMPORARY TABLE IF NOT EXISTS finaltab
	( 
	_totalOpening DECIMAL(12,2),
	_totalTransDebit DECIMAL(12,2),
	_totalTransCredit DECIMAL(12,2),
	_totalClosingDebit DECIMAL(12,2),
	_totalClosingCredit DECIMAL(12,2),
	_AccountName VARCHAR(100)
	);
	
	   
	OPEN MYCURSOR;
	account_master: LOOP
	FETCH  MYCURSOR INTO AccountName,OpeningBalance,AccountId;
	  SET balance :=OpeningBalance;
	  SET opbal := OpeningBalance;
	  
	   IF fromDate > fiscalstartdate THEN
	      SET totdebit:=  (SELECT  IFNULL(SUM(VD.voucher_amount ),0) 
						FROM voucher_detail VD
						INNER JOIN voucher_master VM
						ON VD.voucher_master_id =VM.id
						AND VD.is_debit ='Y' AND VD.account_master_id =AccountId
						AND VM.voucher_date >= fiscalstartdate AND VM.voucher_date < fromDate
						AND VM.school_id =CompanyId
						AND VM.acdm_session_id =YearId);
	      
	      SET totcredit:=  (SELECT  IFNULL(SUM(VD.voucher_amount),0) 
						FROM voucher_detail VD
						INNER JOIN voucher_master VM
						ON VD.voucher_master_id =VM.id
						AND VD.is_debit ='N' AND VD.account_master_id =AccountId
						AND VM.voucher_date >= fiscalstartdate AND VM.voucher_date < fromDate
						AND VM.school_id =CompanyId
						AND VM.acdm_session_id =YearId);
		  
		  SET balance := balance + totdebit - totcredit;
						SET totcredit:=0;
						SET totdebit:=0;
	      
	   
	   END IF;
	   
	   SET totdebit:=  (SELECT  IFNULL(SUM(VD.voucher_amount),0) 
						FROM voucher_detail VD
						INNER JOIN voucher_master VM
						ON VD.voucher_master_id =VM.id
						AND VD.is_debit ='Y' AND VD.account_master_id =AccountId
						AND VM.voucher_date  BETWEEN fromDate AND toDate
						AND VM.school_id =CompanyId
						AND VM.acdm_session_id =YearId);
		  
	     SET totcredit:=  (SELECT  IFNULL(SUM(VD.voucher_amount),0) 
						FROM voucher_detail VD
						INNER JOIN voucher_master VM
						ON VD.voucher_master_id =VM.id
						AND VD.is_debit ='N' AND VD.account_master_id =AccountId
						AND VM.voucher_date  BETWEEN fromDate AND toDate
						AND VM.school_id =CompanyId
						AND VM.acdm_session_id =YearId);      
		  
	    SET balance:= balance + totdebit - totcredit;
	    IF exit_loop THEN
		 CLOSE MYCURSOR;
		 LEAVE account_master;
	     END IF;
		 
		 
	    IF balance < 0
		THEN
					SET creditBalance:= (balance) *(-1);
					SET debitBalance:=0 ;
		ELSE
				
					SET debitBalance:= balance;
					SET creditBalance:=0;
	    END IF;
			INSERT INTO finaltab (_AccountName,_totalOpening ,_totalTransDebit,_totalTransCredit ,_totalClosingDebit,_totalClosingCredit)
			VALUES(AccountName,OpeningBalance,totdebit,totcredit,debitBalance,creditBalance);
				
			SET totcredit:=0;
			SET totdebit:=0;
		SET balance:=0;
	   
	   
	    
	END LOOP account_master;
	SELECT finaltab._AccountName AS Account,finaltab._totalOpening AS Opening,
		finaltab._totalTransDebit AS Debit,finaltab._totalTransCredit AS Credit,finaltab._totalClosingDebit AS closingDebit,
		finaltab._totalClosingCredit AS closingCredit
	FROM finaltab
	WHERE (finaltab._totalOpening <> 0 OR finaltab._totalTransDebit<>0 OR finaltab._totalTransCredit<>0 OR finaltab._totalClosingDebit <>0
	OR finaltab._totalClosingCredit<>0);
  
    END */$$
DELIMITER ;

